import React, { Component } from 'react';
import './index.css';

const SeriesListItem = ({ item }) => {
        <li key={item}>
            {item}
        </li>
}
const SeriesList = (props) => {
    return (
        <div>
            Series List component:
            <ul className = "series-list">
                {props.list.map(item =>( 
                    <SeriesListItem item = {item} />
                ))}
            </ul>
        </div>
    )
}

export default SeriesList;
